import React from 'react'

import { PageWrapper, CopyContainer, Title, Subtitle } from './styledComponents'

export const Home = () => {
	return (
		<PageWrapper>
			<CopyContainer>
				<Title>Stuart & Courtney</Title>
				<Subtitle>July 18th 2020 - South Beloit, IL</Subtitle>
			</CopyContainer>
		</PageWrapper>
	)
}
